	const N = 1024
	paths = make([][]int, 2)
	p := make([]int, 1, N)
	p[0] = 1
	for i := 1; i < N; i <<= 1 {
		for j := 0; j < i; j++ {
			p = append(p, p[j]^3)
		}
		paths[0] = p
	}
	paths[1] = append(paths[0][1:], paths[0][0])

	//const n = math.MaxInt32
	const n = 100
	prime := make([]bool, n)
	hash, ans := [2]uint32{}, [2]int{}
	dif := make([]int, 0)
	for i := n >> 8; i < n; i++ {
		if prime[i] {
			continue
		}
		for j := i << 1; j < n; j += i {
			prime[j] = true
		}
		base := uint32(i)
		hash[0], hash[1] = 0, 0
		for j, path := range paths {
			for _, v := range path {
				hash[j] = hash[j]*base + uint32(v+1)
			}
		}
		switch hash[0] == hash[1] {
		case true:
			ans[0]++
		case false:
			ans[1]++
			dif = append(dif, i)
		}
	}
	fmt.Println(ans)
	fmt.Println(dif)
